import React, { useState, useEffect } from "react";
import axios from "axios";

export default function App() {
  const [businessData, setBusinessData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const pageSize = 25;
  const [filterName, setFilterName] = useState("");
  const [filterCity, setFilterCity] = useState("");
  const [filterState, setFilterState] = useState("");
  const [filterCategories, setFilterCategories] = useState("");

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `http://localhost:3001/api/data?page=${currentPage}&pageSize=${pageSize}&filterName=${filterName}&filterCity=${filterCity}&filterState=${filterState}&filterCategories=${filterCategories}`
        );
        setBusinessData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [currentPage, filterName, filterCity, filterState, filterCategories]);

  const handleFilterChange = (filterSetter, value) => {
    filterSetter(value);
  };

  return (
    <div className="p-3">
      <div className="mb-3">
        <label htmlFor="filterName" className="form-label">
          Filter by Name:
        </label>
        <input
          type="text"
          id="filterName"
          className="form-control"
          value={filterName}
          onChange={(e) => setFilterName(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <label htmlFor="filterCity" className="form-label">
          Filter by City:
        </label>
        <input
          type="text"
          id="filterCity"
          className="form-control"
          value={filterCity}
          onChange={(e) => setFilterCity(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <label htmlFor="filterState" className="form-label">
          Filter by State:
        </label>
        <input
          type="text"
          id="filterState"
          className="form-control"
          value={filterState}
          onChange={(e) => setFilterState(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <label htmlFor="filterCategories" className="form-label">
          Filter by Categories:
        </label>
        <input
          type="text"
          id="filterCategories"
          className="form-control"
          value={filterCategories}
          onChange={(e) => setFilterCategories(e.target.value)}
        />
      </div>

      {filterName && (
        <div className="selected-filters">
          <span className="badge bg-secondary">
            {filterName}
            <button
              type="button"
              className="btn-close"
              aria-label="Close"
              onClick={() => handleFilterChange(setFilterName, "")}
            ></button>
          </span>
        </div>
      )}

      {filterCity && (
        <div className="selected-filters">
          <span className="badge bg-secondary">
            {filterCity}
            <button
              type="button"
              className="btn-close"
              aria-label="Close"
              onClick={() => handleFilterChange(setFilterCity, "")}
            ></button>
          </span>
        </div>
      )}

      {filterState && (
        <div className="selected-filters">
          <span className="badge bg-secondary">
            {filterState}
            <button
              type="button"
              className="btn-close"
              aria-label="Close"
              onClick={() => handleFilterChange(setFilterState, "")}
            ></button>
          </span>
        </div>
      )}

      {filterCategories && (
        <div className="selected-filters">
          <span className="badge bg-secondary">
            {filterCategories}
            <button
              type="button"
              className="btn-close"
              aria-label="Close"
              onClick={() => handleFilterChange(setFilterCategories, "")}
            ></button>
          </span>
        </div>
      )}
      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">business_id</th>
            <th scope="col">name</th>
            <th scope="col">address</th>
            <th scope="col">city</th>
            <th scope="col">state</th>
            <th scope="col">postal_code</th>
            <th scope="col">stars</th>
            <th scope="col">review_count</th>
            <th scope="col">is_open</th>
            <th scope="col">categories</th>
          </tr>
        </thead>
        <tbody>
          {businessData.map((business) => (
            <tr key={business.business_id}>
              <td>{business.business_id}</td>
              <td>{business.name}</td>
              <td>{business.address}</td>
              <td>{business.city}</td>
              <td>{business.state}</td>
              <td>{business.postal_code}</td>
              <td>{business.stars}</td>
              <td>{business.review_count}</td>
              <td>{business.is_open}</td>
              <td>{business.categories}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div class="d-flex justify-content-between align-items-center mb-3">
        <button
          class="btn btn-primary"
          onClick={() =>
            setCurrentPage((prevPage) => Math.max(prevPage - 1, 1))
          }
          disabled={currentPage === 1}
        >
          Previous Page
        </button>
        <span class="h5"> Page {currentPage} </span>
        <button
          class="btn btn-primary"
          onClick={() => setCurrentPage((prevPage) => prevPage + 1)}
        >
          Next Page
        </button>
      </div>
    </div>
  );
}
